 import React from 'react';
 import AppLink from '../link/link';

 const HeaderLogo = () => (
     <div className="logo">
         <AppLink url="/" />
         <span style={{fontFamily:'Caveat, cursive',fontSize: '22px'}}>Instagram</span>
     </div>
 )

 export default HeaderLogo;
